import styled from 'styled-components'


const Form = styled.form`
    width:60%;
    display:flex;
    flex-direction:column;
    align-items:center;
    border: 2px solid black;
`

const Button = styled.button`
    width:10%;
    display:flex;
`

const Label = styled.label`
    margin: 2%;
`



export {Form, Button, Label }
